int main(void)
{
	RCC->rcc_ahb1_enr|= SET_GPIOA_EN;
	RCC->rcc_ahb1_enr|= SET_GPIOD_EN;
	GPIOD->gpio_mode_reg&= CLEAR_GPIOD_PIN12_MODE;
	GPIOD->gpio_mode_reg|= SET_GPIOD_PIN12_MODE_OUTPUT;

	while (1)
	{
		for (int i = 0; i<50000; i++)
		{
			GPIOD->gpio_output_data_reg|= SET_GPIOD_PIN12_OUTPUT;
		}
		for(int j = 0; j<50000; j++)
		{
			GPIOD->gpio_output_data_reg&= CLEAR_GPIOD_PIN12_OUTPUT;
		}
	}
    /* Loop forever */
	for(;;);
}
